<p>–£¬†—Ç–≤–æ—Ä–µ–Ω–Ω—ñ –æ—Å—Ç–∞–Ω–Ω—å–æ—ó –ø–æ–ª—è–≥–∞—î –æ–¥–Ω–∞ –∑¬†–π–æ–≥–æ –∑–∞—Å–ª—É–≥. –ß–∞—Å—Ç–æ, –∫–ª–∞–¥—É—á–∏ –≤¬†–æ—Å–Ω–æ–≤—É –±–∞–π–∫–∏ –Ω–∞—Ä–æ–¥–Ω—É –ø—Ä–∏–∫–∞–∑–∫—É, –≤—ñ–Ω –Ω–∞–±–ª–∏–∂–∞—î –¥–æ¬†–Ω–µ—ó —Å–∞–º—É –ø–æ–±—É–¥–æ–≤—É —Å–≤–æ—ó—Ö —Ç–≤–æ—Ä—ñ–≤. –¢–æ–º—É —Ü—ñ¬†–±–∞–π–∫–∏ –ª–∞–∫–æ–Ω—ñ—á–Ω—ñ, —Å–∫–æ–Ω–¥–µ–Ω—Å–æ–≤–∞–Ω—ñ, –Ω–µ¬†–ø–µ—Ä–µ–æ–±—Ç—è–∂–µ–Ω—ñ –¥–æ–≤–≥–∏–º–∏ –æ–ø–∏—Å–∞–º–∏ —Ç–∞¬†–ø–æ–¥—Ä–æ–±–∏—Ü—è–º–∏.</p>
		
			<br><ul>
			
				<li>—Å—Ü–µ–Ω–∞ –∑–Ω–∞–π–æ–º—Å—Ç–≤ –ö–æ—Ä–æ—Å—Ç–µ–Ω—å –£–∫—Ä–∞—ó–Ω–∞.</li>
			
				<li>–∑–Ω–∞–π–æ–º—Å—Ç–≤–∞ –∞–Ω–≥–ª—ñ–π—Å—å–∫–∞ –ë–æ—Ä–∏—Å–ª–∞–≤ –£–∫—Ä–∞—ó–Ω–∞!</li>
			
				<li>–ü–æ–¥—ñ—ó —Ö—Ä–∏—Å—Ç–∏—è–Ω—Å—å–∫–æ–≥–æ —à–≤–∏–¥–∫–æ–≥–æ –∑–Ω–∞–π–æ–º—Å—Ç–≤–∞ –≤ –í–æ–∑–Ω–µ—Å–µ–Ω—ñ–≤–∫–∞ –£–∫—Ä–∞—ó–Ω–∞.</li>
			
			</ul>
		
	<p>–£–∫—Ä–∞—ó–Ω—Å—å–∫–∏–π –ø–æ–µ—Ç —Å—Ç–≤–æ—Ä–∏–≤ –∑—Ä–∞–∑–∫–∏ —Ç—ñ—î—ó —Ä–µ–∞–ª—ñ—Å—Ç–∏—á–Ω–æ—ó –≤—ñ—Ä—à–æ–≤–∞–Ω–æ—ó –±–∞–π–∫–∏, —â–æ¬†—Å—Ç–∞–ª–∞ —Å–≤–æ—î—Ä—ñ–¥–Ω–∏–º –µ—Ç–∞–ª–æ–Ω–æ–º —Ü—å–æ–≥–æ –∂–∞–Ω—Ä—É –≤¬†–ø–æ–¥–∞–ª—å—à–æ–º—É —Ä–æ–∑–≤–∏—Ç–∫—É —É–∫—Ä–∞—ó–Ω—Å—å–∫–æ—ó –ª—ñ—Ç–µ—Ä–∞—Ç—É—Ä–∏. –°–ª–∞–≤—É –ì—Ä–µ–±—ñ–Ω—Ü—ñ —è–∫¬†–±–∞–π–∫–∞—Ä–µ–≤—ñ –ø—Ä–∏–Ω–µ—Å–ª–∏ ¬´–ú–∞–ª–æ—Ä–æ—Å—Å–∏–π—Å–∫–∏–µ –ø—Ä–∏—Å–∫–∞–∑–∫–∏¬ª –∑¬†–ø—Ä–∏—Å–≤—è—Ç–æ—é ¬´–î–æ–±—Ä—ã–º –º–æ–∏–º –∑–µ–º–ª—è–∫–∞–º –∏¬†–ª—é–±–∏—Ç–µ–ª—è–º –º–∞–ª–æ—Ä–æ—Å—Å–∏–π—Å–∫–æ–≥–æ —Å–ª–æ–≤–∞¬ª , –≤–∏–¥–∞–Ω—ñ –≤¬†–ü–µ—Ç–µ—Ä–±—É—Ä–∑—ñ –≤¬†¬†—ñ ¬†pp. –ó–Ω–∞—á–Ω–∞ —á–∞—Å—Ç–∏–Ω–∞ –±–∞–π–æ–∫ –Ñ. –ù–∞–ø–∏—Å–∞–Ω—ñ –≤¬†–≥—É–º–æ—Ä–∏—Å—Ç–∏—á–Ω–æ-–ø–æ–≤—á–∞–ª—å–Ω–æ–º—É –ø–ª–∞–Ω—ñ, –±–∞–π–∫–∏ —Ü—å–æ–≥–æ —Ü–∏–∫–ª—É —á–∞—Å–æ–º –ø—Ä–æ–π–Ω—è—Ç—ñ —ñ—Å–∫—Ä–∏—Å—Ç–∏–º –Ω–∞—Ä–æ–¥–Ω–∏–º —Å–º—ñ—Ö–æ–º, –ø–æ–∑–Ω–∞—á–µ–Ω—ñ –∫–æ–º—ñ–∑–º–æ–º —Å–∏—Ç—É–∞—Ü—ñ–π, –Ω–∞—Å–∏—á–µ–Ω—ñ –∫–æ–ª–æ—Ä–∏—Ç–Ω–∏–º–∏ –∫–∞—Ä—Ç–∏–Ω–∞–º–∏ —Å–µ–ª—è–Ω—Å—å–∫–æ–≥–æ –ø–æ–±—É—Ç—É.</p>
<p>–£¬†–¥–µ—è–∫–∏—Ö –∑¬†–Ω–∏—Ö –±–∞–π–∫–∞—Ä —Ç–≤–æ—Ä—á–æ –≤–∏–∫–æ—Ä–∏—Å—Ç–∞–≤ —Ç—Ä–∞–¥–∏—Ü—ñ–π–Ω—ñ –º–æ—Ç–∏–≤–∏, –æ–ø—Ä–∞—Ü—å–æ–≤–∞–Ω—ñ —â–µ¬†–∞–Ω—Ç–∏—á–Ω–∏–º–∏ –∞–≤—Ç–æ—Ä–∞–º–∏ —Ç–∞¬†—ó—Ö–Ω—ñ–º–∏ –ø–æ—Å–ª—ñ–¥–æ–≤–Ω–∏–∫–∞–º–∏. –ó–∞¬†—Å–ª–æ–≤–∞–º–∏ –Ü. –§—Ä–∞–Ω–∫–∞, ¬´—è–∫¬†–±–∞–π–∫–æ–ø–∏—Å, –∑–∞–π–º–∞—î –ì—Ä–µ–±—ñ–Ω–∫–∞ –ø–µ—Ä—à–µ –º—ñ—Å—Ü–µ –≤¬†–Ω–∞—à—ñ–º –ø–∏—Å—å–º–µ–Ω—Å—Ç–≤—ñ. –ô–æ–≥–æ –±–∞–π–∫–∏ –≤–∏–∑–Ω–∞—á–∞—é—Ç—å—Å—è —è—Ä–∫–∏–º –Ω–∞—Ü—ñ–æ–Ω–∞–ª—å–Ω–∏–º —ñ¬†–Ω–∞–≤—ñ—Ç—å —Å–ø–µ—Ü—ñ–∞–ª—å–Ω–æ –ª—ñ–≤–æ–±–µ—Ä–µ–∂–Ω–∏–º —É–∫—Ä–∞—ó–Ω—Å—å–∫–∏–º –∫–æ–ª–æ—Ä–∏—Ç–æ–º, —ñ¬†–Ω–µ¬†–º–µ–Ω—à –∑–¥–æ—Ä–æ–≤–æ—é —Å—É—Å–ø—ñ–ª—å–Ω–æ—é —ñ¬†–ª—ñ–±–µ—Ä–∞–ª—å–Ω–æ—é —Ç–µ–Ω–¥–µ–Ω—Ü—ñ—î—é¬ª.</p>
<p>–õ—ñ—Ä–∏—á–Ω—ñ –ø–æ–µ–∑—ñ—ó –Ñ. –ì—Ä–µ–±—ñ–Ω–∫–∞ –ø–∏—Å–∞–≤ —É–∫—Ä–∞—ó–Ω—Å—å–∫–æ—é —ñ¬†—Ä–æ—Å—ñ–π—Å—å–∫–æ—é –º–æ–≤–∞–º–∏. –î–ª—è –Ω–∏—Ö —Ö–∞—Ä–∞–∫—Ç–µ—Ä–Ω–∞ —Ç–µ–º–∞—Ç–∏—á–Ω–∞ –π¬†—Ö—É–¥–æ–∂–Ω—è —Å–ø—ñ–≤–≤—ñ–¥–Ω–µ—Å–µ–Ω—ñ—Å—Ç—å –∑¬†—É–∫—Ä–∞—ó–Ω—Å—å–∫–∏–º–∏ –Ω–∞—Ä–æ–¥–Ω–∏–º–∏ –ø—ñ—Å–Ω—è–º–∏; —Ö—É–¥–æ–∂–Ω—è —Å—Ç—Ä—É–∫—Ç—É—Ä–∞ —ó—Ö¬†–æ—Å–Ω–æ–≤—É–≤–∞–ª–∞—Å—è –Ω–∞¬†—Ä–æ–º–∞–Ω—Ç–∏–∑–º—ñ. –¢–∞–∫, –æ–±—Ä–∞–∑ —á–æ–≤–Ω–∞ –ø–æ–µ–∑—ñ—è ¬´–ß–æ–≤–µ–Ω¬ª —Å–ø—ñ–≤–≤—ñ–¥–Ω–æ—Å–∏—Ç—å—Å—è –∑¬†–ª—é–¥–∏–Ω–æ—é, —â–æ¬†–≤—ñ–¥–≤–∞–∂–Ω–æ –≤–∏—Ä—É—à–∞—î –Ω–∞–∑—É—Å—Ç—Ä—ñ—á –Ω–µ—Å–ø–æ–∫—ñ–π–Ω—ñ–π –∂–∏—Ç—Ç—î–≤—ñ–π —Ö–≤–∏–ª—ñ; —Ä–æ–º–∞–Ω—Ç–∏—á–Ω–∏–π –æ–±—Ä–∞–∑ –æ—Å–æ–±–∏—Å—Ç–æ—Å—Ç—ñ –ø–æ—Å—Ç–∞—î –≤¬†¬´–£–∫—Ä–∞—ó–Ω—Å—å–∫—ñ–π –º–µ–ª–æ–¥—ñ—ó¬ª ¬´–ù—ñ, –º–∞–º–æ, –Ω–µ¬†–º–æ–∂–Ω–∞ –Ω–µ–ª—é–±–∞ –ª—é–±–∏—Ç—å¬ª , —â–æ¬†—Å—Ç–∞–ª–∞ –≤—ñ–¥–æ–º–∏–º —Ä–æ–º–∞–Ω—Å–æ–º; –µ–ª–µ–≥—ñ–π–Ω—ñ –º–æ—Ç–∏–≤–∏ –¥—É—à–µ–≤–Ω–∏—Ö —Å—Ç—Ä–∞–∂–¥–∞–Ω—å –ø—Ä–∏–π–º–∞—é—Ç—å –ø–æ–µ–∑—ñ—ó ¬´–ó–∞–∫–≤—ñ—Ç—á–∞–ª–∞—Å—è –¥—ñ–≤—á–∏–Ω–∞¬ª, ¬´–ú–∞—Ä—É—Å—è¬ª —Ç–∞¬†—ñ–Ω.</p>
<p>–Ø–∫¬†—ñ¬†–≤¬†–±–∞–π–∫–∞—Ö, —É¬†–ª—ñ—Ä–∏—á–Ω–∏—Ö –ø–æ–µ–∑—ñ—è—Ö –≤—ñ–Ω —É—Å–ø—ñ—à–Ω–æ –ø–µ—Ä–µ–±–æ—Ä—é–≤–∞–≤ –±—É—Ä–ª–µ—Å–∫–Ω—É —Ç—Ä–∞–¥–∏—Ü—ñ—é, —á–æ–º—É —Å–ø—Ä–∏—è–ª–æ –∑–∞—Ö–æ–ø–ª–µ–Ω–Ω—è –Ω–∞—Ä–æ–¥–Ω–æ–ø—ñ—Å–µ–Ω–Ω–æ—é –ª–µ–∫—Å–∏–∫–æ—é —Ç–∞¬†—Ñ—Ä–∞–∑–µ–æ–ª–æ–≥—ñ—î—é. –î–µ—è–∫—ñ —Ä–æ—Å—ñ–π—Å—å–∫–æ–º–æ–≤–Ω—ñ –ø–æ–µ–∑—ñ—ó –Ñ. –ì—Ä–µ–±—ñ–Ω–∫–∏ —Ç–∞–∫–æ–∂ —Å—Ç–∞–ª–∏ –ø–æ–ø—É–ª—è—Ä–Ω–∏–º–∏ –ø—ñ—Å–Ω—è–º–∏ ¬´–û—á–∏ —á–µ—Ä–Ω—ã–µ¬ª, ¬´–ú–æ–ª–æ–¥–∞ –µ—â–µ –¥–µ–≤–∏—Ü–∞ —è¬†–±—ã–ª–∞¬ª. –•—É–¥–æ–∂–Ω—î –≤—Ç—ñ–ª–µ–Ω–Ω—è —É–∫—Ä–∞—ó–Ω—Å—å–∫–∞ —Ç–µ–º–∞—Ç–∏–∫–∞ –∑–Ω–∞–π—à–ª–∞ –≤¬†–ø–æ–≤—ñ—Å—Ç—ñ –Ñ. –ì—Ä–µ–±—ñ–Ω–∫–∏ ¬´–ù–µ–∂–∏–Ω—Å–∫–∏–π –ø–æ–ª–∫–æ–≤–Ω–∏–∫ –ó–æ–ª–æ—Ç–∞—Ä–µ–Ω–∫–æ¬ª —Ç–∞¬†—Ä–æ–º–∞–Ω—ñ ¬´–ß–∞–π–∫–æ–≤—Å–∫–∏–π¬ª  –ì—Ä–µ–±—ñ–Ω–∫–∏¬†‚Äî ¬´–ü—Ä–∏–∫–ª—é—á–µ–Ω–∏—è —Å–∏–Ω–µ–π –∞—Å—Å–∏–≥–Ω–∞—Ü–∏–∏¬ª, —É¬†—è–∫—ñ–π –≤–∏–∫—Ä–∏–≤–∞–ª—å–Ω–∏–π –ø–∞—Ñ–æ—Å, —Å–∞—Ç–∏—Ä–∏—á–Ω—ñ —Ç–µ–Ω–¥–µ–Ω—Ü—ñ—ó, –ø–æ—Ä—ñ–≤–Ω—è–Ω–æ –∑¬†–ø–æ–ø–µ—Ä–µ–¥–Ω—ñ–º–∏ —Ç–≤–æ—Ä–∞–º–∏, –≤–∏—è–≤–∏–ª–∏—Å—è –Ω–∞–±–∞–≥–∞—Ç–æ –≤–∏—Ä–∞–∑–Ω—ñ—à–µ. –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –∑ –¥—ñ–≤—á–∞—Ç–∞–º–∏ –≤ –£–∫—Ä–∞—ó–Ω—ñ.</p>
